function pairElement(str) {
  let strArr = str.split("");
  console.log(strArr);

  for (let i = 0; i < strArr.length; i++) {
    if (strArr[i] == 'A') {
      let array = [strArr[i], 'T'];
      strArr[i] = array;
    } else if (strArr[i] == 'T') {
      let array = [strArr[i], 'A'];
      strArr[i] = array;
    } else if (strArr[i] == 'C') {
      let array = [strArr[i], 'G'];
      strArr[i] = array;
    } else if (strArr[i] == 'G') {
      let array = [strArr[i], 'C'];
      strArr[i] = array;
    }
  }
  return strArr;
}

